import {makeStyles} from '@material-ui/core';


export const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        '& back-btn-wrapper': {
            display: 'flex',
            justifyContent: 'center',
            '& > button': {
                width: '250px',
                height: '40px',
                color: theme.palette.primary.white
            },
        }
    }
}))
